import React from 'react';
import './styles.css';

export default function Login(){
    return(
        <div className="container">
            <section className="form">
                <form action="">
                    <h1>Login</h1>
                    <fieldset>
                    <input placeholder="Your email" type="text"/>

                    </fieldset>
                    <legend>
                        <h2>Fill with data</h2>
                    </legend>
                    <button type="submit">Submit</button>
                </form>

            </section>
        </div>
    )
}
